import React from 'react';

const Footer = () => {
  return (
    <div id="footer" className="fixed bottom-0 left-0 w-full bg-gray-900 text-white p-4">
      <ul className="flex justify-center space-x-6">
        <li><button className="focus:outline-none"><i className="fab fa-youtube"></i> YouTube</button></li>
        <li><button className="focus:outline-none"><i className="fab fa-facebook"></i> Facebook</button></li>
        <li><button className="focus:outline-none"><i className="fab fa-twitter"></i> Twitter</button></li>
        <li><button className="focus:outline-none">Help</button></li>
      </ul>
    </div>
  );
};

export default Footer;
